INSERT INTO `project_updates` (`project_update_id`,`project_id`,`member_id`,`public`,`title`,`text`,`created_at`,`changed_at`,`source_id`,`source_pk`) VALUES (42179,1193365,24,1,'test','- SliderEditor has been converted to bootstrap 3 carousel because of license issues.\n- News will be displayed on the dashboard now.\n- Additional files and folders under <project>/content/* will also be copied to the deploy directory while building the site.\n    This makes it possible to deploy for example robots.txt, google<id>.html and other files.\n- Added a warning when SiteWizard will override an already existing site\n- The install directory can now be choosen prior to install FlatSiteBuilder\n- lalalalalalalalala','2017-11-10 10:09:54','2017-11-10 11:10:23',0,NULL);
INSERT INTO `project_updates` (`project_update_id`,`project_id`,`member_id`,`public`,`title`,`text`,`created_at`,`changed_at`,`source_id`,`source_pk`) VALUES (42180,1193365,24,0,'test','- SliderEditor has been converted to bootstrap 3 carousel because of license issues.<br />\n- News will be displayed on the dashboard now.<br />\n- Additional files and folders under &lt;project&gt;/content/* will also be copied to the deploy directory while building the site.<br />\n    This makes it possible to deploy for example robots.txt, google&lt;id&gt;.html and other files.<br />\n- Added a warning when SiteWizard will override an already existing site<br />\n- The install directory can now be choosen prior to install FlatSiteBuilder','2017-11-10 10:10:37','2017-11-10 11:10:31',0,NULL);
